mapboxgl.accessToken = mapboxToken;

    // MAP //
var map = new mapboxgl.Map({
    container: 'map',      // property is container, value is map //
    style: "mapbox://styles/mapbox/light-v10",
    zoom: 3.7,
    center: [-110.4916, 33.4252],
    pitch: 0,
    bearing: 0,
    antialias: true
});



    // MAP CONTROLS //

map.on('load', function() {
    map.addSource('places', {
        'type': 'geojson',
        'data': {
            'type': 'FeatureCollection',
            'features': [
                {
                    'type': 'Feature',
                    'properties': {
                        'description':
                        '<div class="card mb-3" style="width: 100%">\n' +
                            '<div class="row no-gutters">\n' +
                            '    <img src="data:image/jpeg;base64," class="d-block w-100" alt="springrolls">\n' +
                            '</div>\n' +
                            '      <div class="card-body">\n' +
                            '        <h5 class="card-title">Taste Of Asia</h5>\n' +
                            '        <p class="card-text">Casual go-to doling out Chinese & Vietnamese standards, including spring rolls, pho & moo shu.</p>\n' +
                            '        <p class="card-text"><small class="text-muted"><a href="https://www.yelp.com/biz/taste-of-asia-san-antonio-2" target="_blank">(210) 499-5572</a></small></p>\n' +
                            '      </div>\n' +
                            '    </div>\n' +
                            '  </div>\n' +
                            '</div>',
                        'icon': 'restaurant-noodle'
                    },
                    'geometry': {
                        'type': 'Point',
                        'coordinates': [-98.4878923, 29.5685463]
                    }
                },
                {
                    'type': 'Feature',
                    'properties': {
                        'description':
                            '<div class="card mb-3" style="width: 100%">\n' +
                            '<div class="row no-gutters">\n' +
                            '    <img src="data:image/jpeg;base64,\n" class="d-block w-100" alt="noodles">\n' +
                            '</div>\n' +
                            '      <div class="card-body">\n' +
                            '        <h5 class="card-title">Boiling Point</h5>\n' +
                            '        <p class="card-text">Counter-serve chain offering Pan-Asian hot-pot soups, desserts & tea in a relaxed, stylish setting.</p>\n' +
                            '        <p class="card-text"><small class="text-muted"><a href="https://www.bpgroupusa.com/" target="_blank">(206) 336-7321</a></small></p>\n' +
                            '      </div>\n' +
                            '    </div>\n' +
                            '  </div>\n' +
                            '</div>',
                        'icon': 'restaurant-noodle'
                    },
                    'geometry': {
                        'type': 'Point',
                        'coordinates': [-122.255444, 47.4548815]
                    }
                },
                {
                    'type': 'Feature',
                    'properties': {
                        'description':
                            '<div class="card mb-3" style="width: 100%">\n' +
                            '<div class="row no-gutters">\n' +
                            '    <img src="data:image/jpeg;base64,\n" class="d-block w-100" alt="burger">\n' +
                            '</div>\n' +
                            '      <div class="card-body">\n' +
                            '        <h5 class="card-title">What-A-Burger</h5>\n' +
                            '        <p class="card-text">Since 1950, we’ve been serving hot, made-to-order burgers and more with a smile. So come on over. We’re cooking up breakfast, lunch and dinner—from burgers and chicken sandwiches to biscuits and pancakes—to satisfy the heartiest appetites.</p>\n' +
                            '        <p class="card-text"><small class="text-muted"><a href="https://locations.whataburger.com/tx/schertz/5570-fm-3009.html" target="_blank">(210) 651-9858</a></small></p>\n' +
                            '      </div>\n' +
                            '    </div>\n' +
                            '  </div>\n' +
                            '</div>',
                        'icon': 'drinking-water'
                    },
                    'geometry': {
                        'type': 'Point',
                        'coordinates': [-98.2779, 29.60202]
                    }
                }
            ]
        }
    });
    // Layer for places //
    map.addLayer({
        'id': 'places',
        'type': 'symbol',
        'source': 'places',
        'layout': {
            'icon-image': '{icon}-15',
            'icon-allow-overlap': true
        }
    });



    // When a click event occurs on a feature in the places layer, open a popup at the
// location of the feature, with description HTML from its properties.
    map.on('click', 'places', function(e) {
        var coordinates = e.features[0].geometry.coordinates.slice();
        var description = e.features[0].properties.description;
        map.flyTo({ center: e.features[0].geometry.coordinates });


// Ensure that if the map is zoomed out such that multiple
// copies of the feature are visible, the popup appears
// over the copy being pointed to.
        while (Math.abs(e.lngLat.lng - coordinates[0]) > 180) {
            coordinates[0] += e.lngLat.lng > coordinates[0] ? 360 : -360;
        }

        new mapboxgl.Popup()
            .setLngLat(coordinates)
            .setHTML(description)
            .addTo(map);
    });

// Change the cursor to a pointer when the mouse is over the places layer.
    map.on('mouseenter', 'places', function() {
        map.getCanvas().style.cursor = 'pointer';
    });

// Change it back to a pointer when it leaves.
    map.on('mouseleave', 'places', function() {
        map.getCanvas().style.cursor = '';
    });
});





